.CODE
MAIN PROC FAR
	                       MOV  AX,@data
	                       MOV  DS,AX
	                       CALL MAINMENU
	                       CALL STARTINGSCREEN
MAIN ENDP
;-------------------------------------MAIN MENU PROCEDURES----------------------------------------------
STARTINGSCREEN proc

	                       CALL SHOWNAMES
	                       CALL OPTIONSMENU
	                       RET
STARTINGSCREEN ENDP
MAINMENU PROC
	STARTMENU:             MOV  AH,0
	                       MOV  AL,3
	                       INT  10H
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 25
	                       MOV  DH , 5
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       MOV  DX, OFFSET MSG1
	                       MOV  AH,9
	                       INT  21H
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 20
	                       MOV  DH , 6
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       MOV  DX, OFFSET MSG2
	                       MOV  AH,9
	                       INT  21H
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 25
	                       MOV  DH , 7
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       CMP  ISFIRSTPLAYER , 1
	                       JZ   PLAYERONE
	                       JMP  PLAYERTWO

	CONT:                  MOV  AH,9
	                       INT  21H

	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 25
	                       MOV  DH , 9
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       MOV  DX, OFFSET MSG4
	                       MOV  AH,9
	                       INT  21H
	;;;;;;;;;;;;;;;;;;;;;;
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 25
	                       MOV  DH , 11
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       MOV  DX, OFFSET MSG5
	                       MOV  AH,9
	                       INT  21H
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 3
	                       MOV  DH , 19
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       MOV  DX, OFFSET MSG6
	                       MOV  AH,9
	                       INT  21H
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 32
	                       MOV  DH , 9
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	;; Read name
	                       CMP  ISFIRSTPLAYER , 1
	                       JZ   PLAYERONEstore
	                       JMP  PLAYERTWOstore
	CONT2:                 MOV  AH,0Ah
	                       INT  21H
	                       CMP  ISFIRSTPLAYER,1
	                       JNZ  ENDPR
	                       MOV  ISFIRSTPLAYER , 0
	                       JMP  STARTMENU
	PLAYERONE:             MOV  DX, OFFSET MSG3
	                       JMP  CONT
	PLAYERTWO:             MOV  DX,OFFSET MSG7
	                       JMP  CONT
	PLAYERONEstore:        MOV  DX , OFFSET FIRST_PLAYER_NAME
	                       JMP  CONT2
	PLAYERTWOstore:        MOV  DX , OFFSET SECOND_PLAYER_NAME
	                       JMP  CONT2
	ENDPR:                 MOV  ISFIRSTPLAYER , 1
	                       RET
MAINMENU ENDP
;;------------------DISPLAY THE NAME OF ENTERED USERS-------------
SHOWNAMES PROC
	                       MOV  AH,0
	                       MOV  AL,3
	                       INT  10H
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 20
	                       MOV  DH , 10
	                       MOV  AH,2
	                       INT  10h
	                       MOV  DX, OFFSET MSG8
	                       MOV  AH,9
	                       INT  21H
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 35
	                       MOV  DH , 10
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       MOV  DX, OFFSET FIRST_PLAYER_NAME+2
	                       MOV  AH,9
	                       INT  21H
	                       MOV  DL , 20
	                       MOV  DH , 12
	                       MOV  AH,2
	                       INT  10h
	                       MOV  DX, OFFSET MSG9
	                       MOV  AH,9
	                       INT  21H
	;; MOVING CURSOR TO NEEDED POSITION
	                       MOV  DL , 35
	                       MOV  DH , 12
	                       MOV  AH,2
	                       INT  10h
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       MOV  DX, OFFSET SECOND_PLAYER_NAME+2
	                       MOV  AH,9
	                       INT  21H
	;;DELAY THE SCREEN TO SHOW THE NAMES
	                       mov  di,00FFFH
	LOP12:                 MOV  CX,7500
	LOP22:                 LOOP LOP22
	                       DEC  DI
	                       JNZ  LOP12
	                       RET
SHOWNAMES ENDP
OPTIONSMENU PROC
	                       mov  al, 13h
	                       mov  ah, 0
	                       int  10h



	                       MOV  AH,0Bh
	                       MOV  CX, LOGO_W
	                       MOV  DX, LOGO_H
	                       mov  DI, offset LOGO_img
	                       jmp  Start
	Drawit:                
	                       MOV  AH,0Ch
	                       mov  al, [DI]
	                       MOV  BH,00h
	                       INT  10h
	Start:                 
	                       inc  DI
	                       DEC  Cx
	                       JNZ  Drawit
	                       mov  Cx, LOGO_W
	                       DEC  DX
	                       JZ   CHECKS
	                       Jmp  Drawit

	

	CHECKS:                MOV  AH,1
	                       INT  16H
	                       JZ   CHECKS
	                       MOV  AH,0
	                       INT  16H
	                       CMP  AL ,1BH
	                       JZ   ESCAPE
	                       CMP  AH, 59
	                       JZ   STARTCHAT
	                       CMP  AH , 60
	                       JZ   STARTGAME
	                       JMP  CHECKS
	ESCAPE:                CALL MAINMENU
	                       CALL STARTINGSCREEN
	                       RET
	STARTCHAT:             
	                       mov  dh, 20
	                       mov  dl, 0
	                       mov  ah, 2
	                       int  10h
	                       MOV  DX, OFFSET MSG13
	                       MOV  AH,9
	                       INT  21H
	                       jmp  CHECKS

	STARTGAME:             mov  dh, 20
	                       mov  dl, 0
	                       mov  ah, 2
	                       int  10h
	                       MOV  DX, OFFSET MSG14
	                       MOV  AH,9
	                       INT  21H
	;;DELAY THE SCREEN
	                       mov  di,00FFFH
	LOP12T:                MOV  CX,7500
	LOP22T:                LOOP LOP22T
	                       DEC  DI
	                       JNZ  LOP12T
	                       CALL STARTTHEGAME

OPTIONSMENU ENDP
;----------------------------------------GAME PROCEDURES----------------------------------------------
STARTTHEGAME PROC
	                       mov  ah,0
	                       mov  al,13h
	                       int  10h
	;;Draw Color Background

	;;;;;;;;;;;;;;;;;;;;;;;;;;;
	                       call waitForNewVR
	                       call DrawBackGround

	; Drawing health bars
	                       mov  HealthBarPos, 'F'                 	; stands for first player's health bar
	                       call Draw_Health_Bar
                   
                    
	                       mov  HealthBarPos, 'S'                 	; stands for second player's health bar
	                       call Draw_Health_Bar
	                       inc  HealthBarDrawn                    	; to indicate that it has been drawn once
						
	                       mov  CurrentPowerUp, 0
	                       call GenerateRandomNumber
	                       call GenerateRandomPowerUp
	                       call DrawHeart
	                       mov  CurrentPowerUp, 1
	                       call GenerateRandomNumber
	                       call GenerateRandomPowerUp2
	                       call DrawHeart2
	                       call DrawCatLogo
	                       call DrawDogLogo
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	CatDrawing:            
	                       mov  BX , 0
	                       mov  xCoord , BX
	                       mov  yCoord , 115
	                       call DrawCat
	                    

	DogDrawing:            
	                       mov  BX , 200
	                       mov  DX  ,115
	                       mov  xd, BX
	                       mov  yd , DX
	                       call DrawDog
     
						   						  

					
	;call CharacterGravity

	                       call read_the_key

	ENDING:                
	                       RET
STARTTHEGAME ENDP

;;----------------------DRAW BACKGROUND AND THE STEPS--------------------
DrawBackGround proc
	                       MOV  CX ,0
	                       MOV  DX ,0
	                       MOV  AL,0Bh
	                       MOV  AH,0Ch
	FILL:                  INT  10h
	                       INC  CX
	                       CMP  CX,320
	                       JNZ  FILL
	                       INC  DX
	                       MOV  CX,0
	                       CMP  DX,140
	                       JNZ  FILL
	                       JMP  LINEDRAWING
	;;DRAW LINE BETWEEN GROUND AND SKY
	LINEDRAWING:           
	                       MOV  CX ,0
	                       MOV  DX ,140
	                       MOV  AL,02h
	                       MOV  AH,0Ch
	FILL3:                 INT  10h
	                       INC  CX
	                       CMP  CX,320
	                       JNZ  FILL3
	                       INC  DX
	                       MOV  CX,0
	                       CMP  DX,146
	                       JNZ  FILL3
	;Drawing Steps
	STEP1:                                                        	;first step on the left
	                       mov  dx, 106
	Start1:                mov  cx, 50
	                       mov  al, 6
	                       mov  ah, 0Ch
	StepDraw1:             int  10h
	                       inc  cx
	                       cmp  cx, 125
	                       jnz  StepDraw1
	                       DEC  dx
	                       cmp  dx, 102
	                       jnz  Start1
	STEP2:                                                        	;second step on the right
	                       mov  dx, 106
	Start2:                mov  cx, 200
	                       mov  al, 6
	                       mov  ah, 0Ch
	StepDraw2:             int  10h
	                       inc  cx
	                       cmp  cx, 275
	                       jnz  StepDraw2
	                       DEC  dx
	                       cmp  dx, 102
	                       jnz  Start2

	STEP3:                                                        	;Top Step
	                       mov  dx, 70
	Start3:                mov  cx, 115
	                       mov  al, 6
	                       mov  ah, 0Ch
	StepDraw3:             int  10h
	                       inc  cx
	                       cmp  cx, 210
	                       jnz  StepDraw3
	                       DEC  dx
	                       cmp  dx, 66
	                       jnz  Start3
	;;;Draw Bottom of the image
	SCREENBOTTOM:          
	                       MOV  CX ,0
	                       MOV  DX ,146
	                       MOV  AL,06h
	                       MOV  AH,0Ch
	FILL2:                 INT  10h
	                       INC  CX
	                       CMP  CX,320
	                       JNZ  FILL2
	                       JMP  CHANGECOLOR
	CONTINUE:              
	                       INC  DX
	                       MOV  CX,0
	                       CMP  DX,165
	                       JNZ  FILL2
	                       ret
	CHANGECOLOR:           
	                       CMP  AL,06h
	                       JZ   COLORBROWN
	                       JMP  COLORBLACK
	COLORBROWN:            
	                       MOV  AL,06h
	                       JMP  CONTINUE
	COLORBLACK:            
	                       MOV  AL,05
	                       JMP  CONTINUE
	                       JMP  FILL2
DrawBackGround Endp

