	                       call GenerateRandomNumber
	                       call GenerateRandomPowerUp2
	DidnotTake2:           
	                       cmp  draw_PowerUp2, 0
	                       jz   ENDINGHeart2
                        
	                       MOV  AH,0Bh
	                       MOV  CX, heart_W
	                       MOV  DX, heart_H
	                       CMP  ChesonPowerUp2, 0
	                       jz   Blackheart2
	                       CMP  ChesonPowerUp2, 1
	                       jz   RedHeart2
	                       CMP  ChesonPowerUp2, 2
	                       jz   Power2
	                       CMP  ChesonPowerUp2, 3
	                       jz   shieldDraw2
	                       CMP  ChesonPowerUp2, 4
