	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;PowerUps;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

GenerateRandomNumber proc

	                       mov  DI, offset RandomNums
	STARTGENERATING:       
	                       CMP  CurrentPowerUp, 1
	                       jnz  RESUME
	                       ADD  DI, 2
	RESUME:                
	                       mov  ah,0h                             	; interrupts to get system time

	                       int  1ah                               	; CX:DX now hold number of clock ticks since midnight

	                       mov  ax,dx

	                       xor  dx,dx

	                       mov  cx,7

	                       div  cx                                	; here dx contains the remainder of the division - from 0 to 6
	                       mov  cx, 2
	                       mov  bx, dx
	                       mov  ax, dx
	                       xor  dx,dx
	                       div  cx
	                       cmp  dx, 1
	                       jne  evenNum
	                       add  bx,1
	evenNum:               
	                       mov  [DI], bx
	                       cmp  CurrentPowerUp, 1
	                       jz   SecondPower
	                       mov  bx, offset steps_to_draw_powerUps
	                       add  bx, [DI]
	                       mov  ax, [bx]
	                       cmp  ax, 3
	                       jz   DrawOnStep3
	                       cmp  ax, 2
	                       jz   DrawOnStep2
	                       cmp  ax, 1
	                       jz   DrawOnStep1
	                       cmp  ax, 0
	                       jz   DontDraw
		
	DrawOnStep3:           
	                       mov  bx, offset PowerUpsYpos
	                       add  bx, 2
	                       mov  ax, [bx]
	                       mov  heart_powerupY, ax
	                       mov  bx, offset RandomXpos_Step3
	                       add  bx, [DI]
	                       mov  ax,heart_powerupX
	                       CMP  ax, [bx]
	                       jz   RESUMEMIDDLE
	                       mov  ax, [bx]
	                       mov  heart_powerupX, ax
	                       jmp  ENDRANDOM

	DrawOnStep2:           
	                       mov  bx, offset PowerUpsYpos
	                       mov  ax, [bx]
	                       mov  heart_powerupY, ax
	                       mov  bx, offset RandomXpos_Step2
	                       add  bx, [DI]
	                       mov  ax,heart_powerupX
	                       CMP  ax, [bx]
	                       jz   RESUMEMIDDLE
	                       mov  ax, [bx]
	                       mov  heart_powerupX, ax
	                       jmp  ENDRANDOM
	DrawOnStep1:           
	                       mov  bx, offset PowerUpsYpos
	                       mov  ax, [bx]
	                       mov  heart_powerupY, ax
	                       mov  bx, offset RandomXpos_Step1
	                       add  bx, [DI]
	                       mov  ax,heart_powerupX
	                       CMP  ax, [bx]
	                       jz   RESUMEMIDDLE
	                       mov  ax, [bx]
	                       mov  heart_powerupX, ax
	                       jmp  ENDRANDOM
	DontDraw:              
	                       mov  draw_PowerUp, 0
	                       jmp  ENDRANDOM
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	RESUMEMIDDLE:          jmp  RESUME
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	SecondPower:           
		
	                       mov  bx, offset steps_to_draw_powerUps2
	                       add  bx, [DI]
	                       mov  ax, [bx]
	                       cmp  ax, 3
	                       jz   DrawOnStep32
	                       cmp  ax, 2
	                       jz   DrawOnStep22
	                       cmp  ax, 1
	                       jz   DrawOnStep12
	                       cmp  ax, 0
	                       jz   DontDraw2
	DrawOnStep32:          
	                       mov  bx, offset PowerUpsYpos
	                       add  bx, 2
	                       mov  ax, [bx]
	                       mov  heart_powerupY2, ax
	                       mov  bx, offset RandomXpos2_Step3
	                       add  bx, [DI]
	                       mov  ax,heart_powerupX2
	                       CMP  ax, [bx]
	                       jz   RESUMEMIDDLE
	                       mov  ax, [bx]
	                       mov  heart_powerupX2, ax
	                       jmp  ENDRANDOM

	DrawOnStep22:          
	                       mov  bx, offset PowerUpsYpos
	                       mov  ax, [bx]
	                       mov  heart_powerupY2, ax
	                       mov  bx, offset RandomXpos2_Step2
	                       add  bx, [DI]
	                       mov  ax,heart_powerupX2
	                       CMP  ax, [bx]
	                       jz   RESUMEMIDDLE
	                       mov  ax, [bx]
	                       mov  heart_powerupX2, ax
	                       jmp  ENDRANDOM
	DrawOnStep12:          
	                       mov  bx, offset PowerUpsYpos
	                       mov  ax, [bx]
	                       mov  heart_powerupY2, ax
	                       mov  bx, offset RandomXpos2_Step1
	                       add  bx, [DI]
	                       mov  ax,heart_powerupX2
	                       CMP  ax, [bx]
	                       jz   RESUMEMIDDLE
	                       mov  ax, [bx]
	                       mov  heart_powerupX2, ax
	                       jmp  ENDRANDOM
	DontDraw2:             
	                       mov  draw_PowerUp2, 0
	ENDRANDOM:             
	                       ret
GenerateRandomNumber Endp
