;--------------------------------------	GAME OVER PROCEDURE------------------------------------------------------------
 GAME_OVER PROC
  
					mov  Player2_DecHealth,0
					mov  Player1_DecHealth,0
					mov  Player1_IncHealth,0
					mov  Player2_IncHealth,0

				;clear
					mov ax,0600h
					mov bh,07
					mov cx,0
					mov dx,184FH
					int 10h 

				

					; graphics mode
					mov ah,0
					mov al,13h
					int 10h

					; move cursor
					mov dl, 7 ; column. 
					mov dh, 3 ; row. 
					mov bx,0
					mov ah, 02h
					int 10h

					; Display ANGRY PETS
					mov ah,09
					mov dh,0
					mov dx, offset ANGRY_PETS
					int 21h
					
					;Set the cursor 
					mov dl, 15 ; column. 
					mov dh, 10 ; row. 
					mov bx,0
					mov ah, 02h
					int 10h
					
					; Display the game over  
					mov ah,09
					mov dh,0
					mov dx, offset GAME_OVER_STR
					int 21h      



					;Set the cursor 
					mov dl, 11 ; column. 
					mov dh, 12 ; row. 
					mov bx,0
					mov ah, 02h
					int 10h
					
					; Display the winner 
					mov ah,09
					mov dh,0
					mov dx, offset THE_WINNER
					int 21h       


					cmp Player2_Health_cx, 253  ; Check this health if it reaches the minimum then player 2 is the loser
					je LOSER_DOG

					cmp Player1_Health_cx, 23   ; Check this health if it reaches the minimum then player 1 is the loser 
					je LOSER_CAT



					LOSER_DOG:  ; then player 1 is the winner
					mov ah,09
					mov dh,0
					mov dx, offset FIRST_PLAYER_NAME+2
					int 21h 
					jmp EndOfTheGame 

					LOSER_CAT:   ; then player 2 is the winner
					mov ah,09
					mov dh,0
					mov dx, offset SECOND_PLAYER_NAME+2
					int 21h 
					jmp EndOfTheGame 

					


			EndOfTheGame:

					; move the cursor to the end of the screen
					mov dl, 0; column. 
					mov dh, 19 ; row. 
					mov bx,0
					mov ah, 02h
					int 10h 
					
					mov cx,40
					Print_ :
					mov ah,2 
					mov dl,'-'
					int 21h 
					loop print_ 

					; move the cursor to the end of the screen
					mov dl, 2 ; column. 
					mov dh,  21 ; row. 
					mov bx,0
					mov ah, 02h
					int 10h

					; display final msg
					mov ah,09
					mov dh,0
					mov dx, offset FINALMSG_MENU
					int 21h 

					; move the cursor
					mov dl, 2 ; column. 
					mov dh,  23 ; row. 
					mov bx,0
					mov ah, 02h
					int 10h
					
					; display final msg
					mov ah,09
					mov dh,0
					mov dx, offset FINALMSG_ESC
					int 21h 

					FINAL_PRESS:
					mov ah,0
					int 16h
					cmp ah, 02
					jz return_to_main_menu 
					cmp ah, 01
					jz end_the_game
					jmp FINAL_PRESS

					return_to_main_menu: 
					call MAINMENU

					end_the_game:
					mov ah,4ch
					int 21h
GAME_OVER Endp


END MAIN